import Link from 'next/link';

const Navbar = () => (
   <div className="container">
       <style global jsx>{`
             nav a {
                -webkit-transition: all 0.5s ease-out;
                -moz-transition: all 0.5s ease-out;
                -o-transition: all 0.5s ease-out;
                -ms-transition: all 0.5s ease-out;
                transition: all 0.5s ease-out;
            }
            nav {
                width: 250px;
                height:250px;
                display:flexbox ;
                
                
                align-content: initial;
            }
            nav img {
                border-radius: 50%;
            }
             
            nav a {
                display: grid;
                text-decoration: none;
                color: blueviolet;
                padding:5px;
                align-content: grid;
            }
            nav  a:hover {
                color: #23527c;
            }
        `}</style> 
        <nav>
        
            <Link href="/">Home</Link>
            <Link href="/about">
                <a>About</a>
            </Link>
            <Link href="/projects">
                <a>Projects</a> 
            </Link>
            <Link href="/contact">
                <a>Contact</a>  
            </Link>
            <p>Siphosethu Gajana's Portfolio</p>
            <img src='./static/Profile.JPG' alt='profileImage'/> 
            
        </nav>
    </div>
)
export default Navbar;
